import React from "react";

import "./FilterSlider.css";

const FilterSlider = (props) => {
  return (
    <div>
        <label>{props.title}</label>
        <input type="range" min={props.min} max={props.max} step={props.step} />
    </div>
  );
};

export default FilterSlider;
